import re
from copy import deepcopy


def del_punctuation(sentence):
    return re.sub(r'[^\w\s]', '', sentence)


def del_space(sentence):
    sentence = sentence.replace("  ", " ")
    sentence = sentence.strip()

    words = sentence.split()
    words = list(map(lambda x : x.strip().replace(" ", ""), words))
    setence = " ".join(words)

    return sentence


def del_numbers(sentence):
    from string import digits
    table = str.maketrans('', '', digits)
    sentence = sentence.translate(table)

    return sentence


def del_emoji(sentence):
    pattern = re.compile(pattern = "["
        u"\U0001F600-\U0001F64F"  
        u"\U0001F300-\U0001F5FF"  
        u"\U0001F680-\U0001F6FF"  
        u"\U0001F1E0-\U0001F1FF"  "]+", flags = re.UNICODE)

    return pattern.sub(r'', sentence)


def lemmatize(sentence):
    lemmatizer = WordNetLemmatizer()
    sentence = " ".join([lemmatizer.lemmatize(word) for word in sentence.split()])

    return sentence


def tokenizer_porter(text):
    porter = PorterStemmer()

    return [porter.stem(word) for word in text.split()]


def preprocess_data(df, flags=[]):
    df = deepcopy(df)
    if 'p' in flags:
        df['consumer complaint'] = df['consumer complaint'].apply(del_punctuation)
    if 's' in flags:
        df['consumer complaint'] = df['consumer complaint'].apply(del_space)
    if 'n' in flags:
        df['consumer complaint'] = df['consumer complaint'].apply(del_numbers)
    if 'e' in flags:
        df['consumer complaint'] = df['consumer complaint'].apply(del_emoji)
    if 'l' in flags:
        df['consumer complaint'] = df['consumer complaint'].apply(lemmatize) 

    return df

